define('slider',['template'], function (template) {
    "use strict";
    //init(); //on page load - show first slide, hidethe rest

    function init() {

        var parents = document.getElementsByClassName('slideshow-container');

        for (var j = 0; j < parents.length; j++) {
            var slides = parents[j].getElementsByClassName("cbSliderItem");
            var dots = parents[j].getElementsByClassName("dot");
            slides[0].classList.add('active-slide');
            dots[0].classList.add('active');
        }
    }

    function slider() {
        var dots = document.getElementsByClassName('dot'); //dots functionality

        for (i = 0; i < dots.length; i++) {

            dots[i].onclick = function () {
                console.log('dot Clicked - ' + i);

                var slides = this.parentNode.parentNode.getElementsByClassName("cbSliderItem");

                for (var j = 0; j < this.parentNode.children.length; j++) {
                    this.parentNode.children[j].classList.remove('active');
                    slides[j].classList.remove('active-slide');
                    if (this.parentNode.children[j] == this) {
                        var index = j;
                    }
                }
                this.classList.add('active');
                slides[index].classList.add('active-slide');

            }
        }
//prev/next functionality
        var links = document.querySelectorAll('.slideshow-container a');

        for (var i = 0; i < links.length; i++) {
            links[i].onclick = function () {
                console.log('item Clicked - ' + i);
                var current = this.parentNode;

                var slides = current.getElementsByClassName("cbSliderItem");
                var dots = current.getElementsByClassName("dot");
                var curr_slide = current.getElementsByClassName('active-slide')[0];
                var curr_dot = current.getElementsByClassName('active')[0];
                curr_slide.classList.remove('active-slide');
                curr_dot.classList.remove('active');
                if (this.className == 'next') {
                    console.log('Next Clicked - ' + i);

                    if (curr_slide.nextElementSibling.classList.contains('cbSliderItem')) {
                        curr_slide.nextElementSibling.classList.add('active-slide');
                        curr_dot.nextElementSibling.classList.add('active');
                    } else {
                        slides[0].classList.add('active-slide');
                        dots[0].classList.add('active');
                    }

                }

                if (this.className == 'prev') {
                    console.log('prev Clicked - ' + i);

                    if (curr_slide.previousElementSibling) {
                        curr_slide.previousElementSibling.classList.add('active-slide');
                        curr_dot.previousElementSibling.classList.add('active');
                    } else {
                        slides[slides.length - 1].classList.add('active-slide');
                        dots[slides.length - 1].classList.add('active');
                    }

                }

            }

        }
    }

    function execute() {
        init();
        slider();
    }
    return{
        execute: execute

    }
});
define('carousel',[], function () {
    "use strict";
    // optimize feature
    function init(input) {
        var carousels = document.querySelectorAll('.js-product-carousel');

        [].forEach.call(carousels, function (carousel) {
            carouselize(carousel);
        });
    }
    function carouselize(carousel) {
        var productList = carousel.querySelector('.js-product-list');
        var productListWidth = 300;
        var productListSteps = 0;
        var products = carousel.querySelectorAll('.product');
        var productAmount = 0;
        var productAmountVisible = 1;
        var carouselPrev = carousel.querySelector('.js-carousel-prev');
        var carouselNext = carousel.querySelector('.js-carousel-next');

        var productAmount=0;

        //Count all the products
        [].forEach.call(products, function (product) {
            productAmount++;
            productListWidth += 300;
            productList.style.width = productListWidth + "px";
        });

        carouselNext.onclick = function () {
            if (productListSteps < productAmount - productAmountVisible) {
                productListSteps++;
                moveProductList();
                console.log('click to Move Next');
            }else {
                console.log('click to Move Next but list less then 0');
            }
        }

        carouselPrev.onclick = function () {
            if (productListSteps > 0) {
                productListSteps--;
                moveProductList();
                console.log('click to Move Prev');
            }else {
                console.log('click to Move Prev but list less then 0');
            }
        }

        // This is a bit hacky, let me know if you find a better way to do this!
        // Move the carousels product-list
        function moveProductList() {
            productList.style.transform = "translateX(-" + 300 * productListSteps + "px)";
        }
    }

    return  {
        execute: init
    }
});

define('pagination', [], function () {
    "use strict";
    return {
        execute: function (tId) {
            // get the table element
            var $table = document.getElementById(tId),
// number of rows per page
                $n = 10,
// number of rows of the table
                $rowCount = $table.rows.length,
// get the first cell's tag name (in the first row)
                $firstRow = $table.rows[0].firstElementChild.tagName,
// boolean var to check if table has a head row
                $hasHead = ($firstRow === "TH"),
// an array to hold each row
                $tr = [],
// loop counters, to start count from rows[1] (2nd row) if the first row has a head tag
                $i, $ii, $j = ($hasHead) ? 1 : 0,
// holds the first row if it has a (<TH>) & nothing if (<TD>)
                $th = ($hasHead ? $table.rows[(0)].outerHTML : "");
// count the number of pages
            var $pageCount = Math.ceil($rowCount / $n);
// if we had one page only, then we have nothing to do ..

            if ($pageCount > 1) {
                // assign each row outHTML (tag name & innerHTML) to the array
                for ($i = $j, $ii = 0; $i < $rowCount; $i++, $ii++)
                    $tr[$ii] = $table.rows[$i].outerHTML;
                // create a div block to hold the buttons
                $table.insertAdjacentHTML("afterend", "<div id='buttons'></div>");
                // the first sort, default page is the first one
                sort(1);
            }


// ($p) is the selected page number. it will be generated when a user clicks a button
            function sort($p) {
                /* create ($rows) a variable to hold the group of rows
                ** to be displayed on the selected page,
                ** ($s) the start point .. the first row in each page, Do The Math
                */
                var $rows = $th, $s = (($n * $p) - $n);
                for ($i = $s; $i < ($s + $n) && $i < $tr.length; $i++)
                    $rows += $tr[$i];

                // now the table has a processed group of rows ..
                $table.innerHTML = $rows;
                // create the pagination buttons
                var btn = document.getElementById("buttons");
                btn.innerHTML = pageButtons($pageCount, $p);
                // CSS Stuff
                document.getElementById("id" + $p).setAttribute("class", "pg-active");

                // Set OnClick
                //var row = set.querySelectorAll('[data-id="'+e.target.dataset.id+'"]')[0];
                var pgBtn = btn.querySelectorAll('.pgBtn');
                for (var i = 0; i < pgBtn.length; i++)
                    pgBtn[i].addEventListener("click", e=>sort(e.target.dataset.id));


            }


// ($pCount) : number of pages,($cur) : current page, the selected one ..
            function pageButtons($pCount, $cur) {
                /* this variables will disable the "Prev" button on 1st page
                   and "next" button on the last one */
                var $prevDis = ($cur == 1) ? "disabled" : "",
                    $nextDis = ($cur == $pCount) ? "disabled" : "",
                    /* this ($buttons) will hold every single button needed
                    ** it will creates each button and sets the onclick attribute
                    ** to the "sort" function with a special ($p) number..
                    */
                    $buttons = "<input class='pgBtn' data-id='"+($cur - 1)+"' type='button' value='&lt;&lt; Prev' " + $prevDis + ">";
                for ($i = 1; $i <= $pCount; $i++)
                    $buttons += "<input class='pgBtn' data-id='"+$i+"' type='button' id='id" + $i + "'value='" + $i + "'>";
                $buttons += "<input class='pgBtn' data-id='"+(parseInt($cur) +1)+"' type='button' value='Next &gt;&gt;' " + $nextDis + ">";
                return $buttons;
            }




        }
    }

});
